      </section>
      <div className="resume-container">
        <div className="resume-image">
          <img src={resume1} alt="Resume 1" />
        </div>
        <div className="resume-image">
          <img src={resume1} alt="Resume 2" />
        </div>
        <div className="resume-image">
          <img src={resume1} alt="Resume 3" />
        </div>
      </div>
    </div>
  );
};

